from fractions import Fraction
from functools import lru_cache
@lru_cache()
def f(m):
    if m == 1: return {Fraction(1, 1)}
    out = set()
    for j in range(1, m//2+1):
        for x in f(j):
            for y in f(m-j):
                out.update([x + y, x * y])
                if y: out.add(Fraction(x, y))
                if x: out.add(Fraction(y, x))
    return out
def a(n): return len(f(n))
